import React from 'react';
import '../styles/Experience.css';

const experiences = [
  {
    company: 'Surebet Jobs',
    position: 'Software Engineer (Part-Time)',
    duration: 'Jan 2023 - Present',
    location: 'San Francisco, CA',
    description: 'Led development of cloud-native applications using React and Node.js. Implemented CI/CD pipelines and improved system performance by 40%.',
    logoUrl: '/company-logos/tech-a.png' // Placeholder logo path
  },
  {
    company: 'Startup B',
    position: 'Full Stack Developer',
    duration: 'Jun 2021 - Dec 2022',
    location: 'New York, NY',
    description: 'Developed and maintained multiple client-facing applications. Collaborated with cross-functional teams to deliver high-quality software solutions.',
    logoUrl: '/company-logos/startup-b.png'
  },
  {
    company: 'Enterprise Corp',
    position: 'Software Developer Intern',
    duration: 'May 2020 - Aug 2020',
    location: 'Seattle, WA',
    description: 'Contributed to the development of internal tools. Worked with senior developers to implement new features and fix bugs.',
    logoUrl: '/company-logos/enterprise.png'
  }
];

const Experience = () => {
  return (
    <section className="experience-section">
      <h2>Experience</h2>
      <div className="timeline">
        {experiences.map((exp, index) => (
          <div key={index} className="timeline-item">
            <div className="timeline-dot">
              <div className="company-logo">
                <img src={exp.logoUrl} alt={`${exp.company} logo`} />
              </div>
            </div>
            <div className="timeline-content">
              <div className="experience-header">
                <h3>{exp.position}</h3>
                <div className="company-name">{exp.company}</div>
              </div>
              <div className="experience-meta">
                <span className="duration">{exp.duration}</span>
                <span className="location">{exp.location}</span>
              </div>
              <p className="description">{exp.description}</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Experience;
